import { Route, Routes, Navigate } from 'react-router-dom';
import Dashboard from './component/main/Dashboard';

function App() {
  return (
    <Routes>
      <Route path="/" element={<Dashboard />} />
      <Route path="*" element={<Navigate to="/" replace />} />
    </Routes>
  );
}
export default App;
